import React from 'react';
import Navbar from './Navbar';
import Footer from './Footer';
import InteractiveTrailSelector from './InteractiveTrailSelector';

const App = () => {
  return (
    <div className="min-h-screen flex flex-col bg-gray-50">
      {/* Navbar */}
      <Navbar />

      {/* Main Content */}
      <main className="flex-1">
        <InteractiveTrailSelector />
      </main>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default App;
